import React from "react"; 
import "./Categorias.css";

const Categorias = () => {
  return (
    <div className="categoria-container">
      <>
        <h2 className="categoria-registro-text">CATEGORIAS REGISTRADAS</h2>
        <div className="categoria-category-list">
          <img src="/path/to/trash-icon.png" alt="Eliminar" className="categoria-trash-icon" />
        </div>
      </>
      <div className="categoria-right-side">
        <div className="categoria-input-group">
          <div className="categoria-text">NOMBRE DE CATEGORIA</div>
          <input type="text" id="category-name" className="categoria-input-field" />
        </div>
        <div className="categoria-input-group">
          <div className="categoria-text">DESCRIPCION</div>
          <textarea id="category-description" className="categoria-textarea-field"></textarea>
        </div>
        <button className="categoria-register-button">REGISTRAR NUEVA CATEGORIA</button>
        <button className="categoria-edit-button">CONFIRMAR EDICION</button>
      </div>
    </div>
  );
};

export default Categorias;
